import React from 'react';
import {useForm} from 'react-hook-form';
import saveData from './index';

export default function Form(){
    const {register, handleSubmit}= useForm();
    return(
        <form onSubmit={handleSubmit(data =>saveData(data))}>
            <h1>Επικοινωνήστε μαζί μας</h1>
            <label>Όνομα</label><input name="name" ref={register}/>
            <label>Διεύθυνση</label><input name="address" ref={register}/>
            <label>Ημερομηνία</label><input name="date" ref={register}/>
            <label>Μήνυμα</label><input name="message" ref={register}/>
            <input type= "submit"/>
        </form>
    );
}
